  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Ottawa
  National Wildlife Refuge, Cedar Point National Wildlife Refuge, West Sister Island
  National Wildlife Refuge, Navarre Unit, and Darby Unit outlines Refuge accomplishments
  during the 1991 fiscal year. The report begins by summarizing climatic conditions
  and land acquisition during the year. The Planning section that follows describes
  general management around the refuge, as well as research. The Administration section
  discusses youth programs, including the YCC camp, and volunteer programs, as well
  as funding and safety. The Habitat Management section, including Wetland Management,
  Cropland Management, and Pesticide Control, follows. Wildlife - including migratory
  birds, upland game birds, big game animals, furbearers, mammals, raptors, and endangered/threatened
  species - is also covered. The Public Use section of the report describes recreational
  uses, environmental education, and interpretive programs. The Equipment and Facilities
  section outlines topics such as new construction, equipment utilization, and computer
  systems. Finally, the report outlines items of interest. Cedar Point and West Island
  National Wildlife Refuge reports are also included.\",\n\t\"license_title\": \"License
